import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Box,
  Typography,
  Button,
  Paper,
  Grid,
  Card,
  CardContent,
  CardActions,
  Chip,
} from '@mui/material';

function DifficultyCard({ title, description, color, points, onSelect }) {
  return (
    <Card
      elevation={3}
      sx={{
        height: '100%',
        display: 'flex',
        flexDirection: 'column',
        transition: 'transform 0.2s',
        '&:hover': {
          transform: 'scale(1.02)',
        },
      }}
    >
      <CardContent sx={{ flexGrow: 1 }}>
        <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 2 }}>
          <Typography variant="h6" component="h3">
            {title}
          </Typography>
          <Chip
            label={`${points} pts/question`}
            color={color}
            size="small"
          />
        </Box>
        <Typography variant="body2" color="text.secondary">
          {description}
        </Typography>
      </CardContent>
      <CardActions>
        <Button
          fullWidth
          variant="contained"
          color={color}
          onClick={onSelect}
        >
          Start {title} Quiz
        </Button>
      </CardActions>
    </Card>
  );
}

function Home() {
  const navigate = useNavigate();
  const [selectedDifficulty, setSelectedDifficulty] = useState(null);

  const difficulties = {
    beginner: {
      title: 'Beginner',
      description: 'Learn the basics of cybersecurity. Perfect for those just starting their security journey.',
      color: 'success',
      points: 10,
    },
    intermediate: {
      title: 'Intermediate',
      description: 'Dive deeper into security concepts with more challenging questions.',
      color: 'warning',
      points: 20,
    },
    advanced: {
      title: 'Advanced',
      description: 'Test your expertise with complex security scenarios and technical questions.',
      color: 'error',
      points: 30,
    },
  };

  const handleDifficultySelect = (difficulty) => {
    setSelectedDifficulty(difficulty);
    navigate('/quiz', { state: { difficulty } });
  };

  return (
    <Box
      sx={{
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        gap: 4,
        py: { xs: 4, md: 8 },
      }}
    >
      <Typography
        variant="h1"
        component="h1"
        align="center"
        sx={{
          mb: 2,
          color: 'primary.main',
          fontWeight: 'bold',
        }}
      >
        CyberQuiz
      </Typography>

      <Typography
        variant="h5"
        component="h2"
        align="center"
        sx={{
          mb: 4,
          maxWidth: 'sm',
          mx: 'auto',
        }}
      >
        Test your cybersecurity knowledge and earn badges while learning to protect yourself online
      </Typography>

      <Grid container spacing={3} sx={{ maxWidth: 'lg', mx: 'auto' }}>
        {Object.entries(difficulties).map(([key, difficulty]) => (
          <Grid item xs={12} sm={6} md={4} key={key}>
            <DifficultyCard
              {...difficulty}
              onSelect={() => handleDifficultySelect(key)}
            />
          </Grid>
        ))}
      </Grid>

      <Box
        sx={{
          mt: 4,
          p: 3,
          backgroundColor: 'background.paper',
          borderRadius: 2,
          width: '100%',
          maxWidth: 'md',
        }}
      >
        <Typography variant="h6" gutterBottom align="center">
          Features
        </Typography>
        <Grid container spacing={3} sx={{ mt: 1 }}>
          <Grid item xs={12} sm={4}>
            <Typography variant="subtitle1" align="center">
              🎯 Interactive Questions
            </Typography>
          </Grid>
          <Grid item xs={12} sm={4}>
            <Typography variant="subtitle1" align="center">
              🏆 Earn Badges
            </Typography>
          </Grid>
          <Grid item xs={12} sm={4}>
            <Typography variant="subtitle1" align="center">
              📱 Mobile Friendly
            </Typography>
          </Grid>
        </Grid>
      </Box>
    </Box>
  );
}

export default Home;
